embedfield:
Correctly use MongoDB composite primary key in $lookup pipeline<p>I have a collection with a composite primary key as such</p>
<pre><code>_id: {
  a: 'a',
  b: 'b'
}
</code></pre>
<p>Explaining the following query, reveals that it does a <strong>COLLSCAN</strong> and the index is not used</p>
<pre><code>db.collection.find({'_id.a': '1', '_id.b': '2'}).explain()
</code></pre>
<p>Changing that query to the following, uses the <strong>IDHACK</strong> successfully.</p>
<pre><code>db.collection.find({_id: {a: '1', b: '2'}}).explain()
</code></pre>
<p>The problem is that this doesn't seem to work if used in the pipeline of a <code>$lookup</code> in an aggregation.</p>
<p>This doesn't return any results:</p>
<pre><code>$lookup: {
  from: 'collection',
  let: {
    pid: '1',
    sid: '2',
  },
  pipeline: [
    {
      $match: {
        _id: {
          a: '$$pid',
          b: '$$sid',
        },
      },
    },
  ],
  as: 'results',
},
</code></pre>
<p>while the format that is not using the index returns results as expected:</p>
<pre><code>$lookup: {
  from: 'collection',
  let: {
    pid: '1',
    sid: '2',
  },
  pipeline: [
    {
      $match: {
        $expr: {
            $and: [
              {
                $eq: [
                  '$_id.a', '$$pid',
                ],
              }, {
                $eq: [
                  '$_id.b', '$$sid',
                ],
              },
            ],
        },
      },
    },
  ],
  as: 'results',
},
</code></pre>
<p>So my question is, how can I modify the lookup pipeline in order to use the index of the composite primary key?</p>

