MongoError: Topology is closed, please connect when making a discord.jsv12 mute command<p>I've seen many people get the Topology is closed error, but I've never seen a straight answer that doesn't only answer the question for the exact code snippet given, but generally gives an overview of what the topology is and how it works.</p>
<p>I'm following the WOK DiscordJSv12 tutorials on YT, and have the mute command cloned from the repo and added some tweaks to include embeds. But as soon as I ran the code i got the topology error.</p>
<p>Here is the file where I get the error:</p>
<pre><code>const muteSchema = require('@schemas/mute-schema')

module.exports = (client) =&gt; {
    const checkMutes = async () =&gt; {
        console.log('CHECKING MUTE DATA')

        const now = new Date()

        const conditional = {
            expires: {
                $lt: now
            },
            current: true,
        }
//The error is on this next line, it doesn't like that 'await'
        const results = await muteSchema.find(conditional)

        if (results &amp;&amp; results.length) {
            for (const result of results) {
                const { guildId, userId } = result

                const guild = client.guilds.cache.get(guildId)
                const member = (await guild.members.fetch()).get(userId)

                const mutedRole = guild.roles.cache.find((role) =&gt; {
                    return role.name === 'Muted'
                })

                member.roles.remove(mutedRole)
            }

            await muteSchema.updateMany(conditional, {
                current: false,
            })
        }

        setTimeout(checkMutes, 1000 * 60 * 10 )
    }
    checkMutes()

    client.on('guildMemberAdd', async (member) =&gt; {
        const { guild, id } = member

        const currentMute = await muteSchema.findOne({
            userId: id,
            guildId: guild.id,
            current: true,
        })

        if (currentMute) {
            const role = guild.roles.cache.find((role) =&gt; {
                return role.name === 'Muted'
            })

            if (role) {
                member.roles.add(role)
            }
        }
    })
}
</code></pre>
<p>Here's the other file that completes the logic of this file: <a href="https://sourceb.in/zeHtjjbcZV" rel="nofollow noreferrer">link</a></p>
<p>Also here is the schema: <a href="https://sourceb.in/S5E9VhfiAc" rel="nofollow noreferrer">link</a></p>
<p>And my mongo file that connects to mongo: <a href="https://sourceb.in/7Xj5Dp7mRn" rel="nofollow noreferrer">link</a></p>
<p>So I'd like to know how to fix my issue, and also for future errors how I can solve it myself and what the error basically means, since there is no exact line of my own code specified in the error.</p>

answer:
@WaxCage We have classes for config values access. Some can fetch them from DB, another from config files, another from hardcoded arrays inside them. You can get a value from such a class by getAsString(), getAsParamObject()... or some similar methods.
It definitely is a bad design, but it is one that I have to work with for now.
These config classes are modified (and broken) often, so I wanted to secure their basic functions (to get the value at least somehow) before I refactor the whole thing.

