Why does local Robo3t connect to a remote Mongo DB instance, but NodeJs fails with IP whitelist error?<p>I am having issues connecting to MongoDb running remotely, and the connection error response I am getting from the server is somewhat weird.</p>
<p>My network access whitelist is set to allow all (0.0.0.0/0). Hence, my local robo3t installation was able to connect. However, I could not connect from my NodeJs code. Error is: &quot;MongooseServerSelectionError: Could not connect to any servers in your MongoDB Atlas cluster. One common reason is that you're trying to access the database from an IP that isn't whitelisted. Make sure your current IP address is on your Atlas cluster's IP whitelist&quot;</p>
<p>IP whitelist seems to be an unlikely error, given that my local robo3t client is able to connect remotely to the same remote Mongo Atlas instance, as IP whitelist is allow-all.</p>
<p>How do I debug this kind of thing, please?</p>
<p><strong>UPDATE:</strong> this is how I connect to MongoDb. Works well on local, too.</p>
<pre><code>try {
    const connectionString =
        process.env.APP_ENV == &quot;test&quot;
            ? await getInMemoryMongoDbAdapter()
            : `mongodb://${process.env.MONGODB_HOSTNAME}:${process.env.MONGODB_PORT}/${process.env.CBT_DATABASE_NAME}`;

    logger.info(`Connecting to MongoDB service: ${connectionString}`);


    await mongoose.connect(connectionString, {
        useNewUrlParser: true,
        useUnifiedTopology: true,
    });
} catch (error) {
    reject(error);
}
</code></pre>
<p>The logger line correctly shows: <code>Connecting to MongoDB service: mongodb://&lt;user&gt;:&lt;password&gt;@cluster0-xxx.yyy.zzz.net:&lt;port&gt;/&lt;database&gt;</code></p>
<p><strong>UPDATE 2</strong>:
My localhost also does not connect via this node app; whereas my robo3t (local MongoDb client) connects. I guess that means Heroku-specific issues can now be comfortably ruled out</p>

